import React from 'react';
import './Carouseler.css';
import { Images } from './Images';
import Carousel from 'react-elastic-carousel';
import collage from '../images/collage.jpeg';
const Carouseler = () => {
  state = {
    items: [
      {id: 1, title: 'item #1'},
      {id: 2, title: 'item #2'},
      {id: 3, title: 'item #3'},
      {id: 4, title: 'item #4'},
      {id: 5, title: 'item #5'}
    ]
  }
  return (
    <Carousel>
      <Images></Images>
    </Carousel>
  );
}
export default Carouseler;
